import React from 'react'
import Header from './components/Header'
import Searchbar from './components/Searchbar'
import Card from './components/Card'

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Searchbar />
        <section class="container">
          <div id="grid" class="grid"></div>
      </section>
      </main>
    </div>
  );
}

export default App;
